// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import "./HashJingSVGStorage.sol";   // <- renamed storage contract
import "@openzeppelin/contracts/utils/Base64.sol";

/** @dev On-chain renderer: turns a 32-byte seed into a finished SVG */
contract FullMandalaRenderer {
    /* ───── geometry ───── */
    uint256 constant SECTORS   = 64;     // 64 × 5 5⁄8 °
    uint256 constant DPHI_MDEG = 5625;   // angle in ‰ degree

    /* ───── tiny reusable snippets ───── */
    bytes constant G_OPEN   = '<g transform="rotate(';
    bytes constant G_MID    = ' 512 512)">';
    bytes constant G_CLOSE  = '</g>';
    bytes constant PATH_END = '"/>';
    bytes constant WHITE    = "#ffffff";
    bytes constant BLACK    = "#000000";
    bytes constant TEXT_END = "</text>";

    /* ───── external SSTORE2 storage with path-prefixes ───── */
    HashJingSVGStorage immutable store;
    constructor(address storageAddr) { store = HashJingSVGStorage(storageAddr); }

    /* ──────────────────────────────────────────────── */

    /// HashJingNFT calls this to get the final SVG
    function svg(bytes32 hash) external view returns (string memory) {
        /* ───── 1. gather parts and compute total length ───── */
        bytes[] memory part = new bytes[](1 + 64*16 + 4*3 + 1);
        uint256 idx; uint256 total;

        // 0) head
        bytes memory head = store.head();
        part[idx++] = head; total += head.length;

        // 1) 64 sectors
        for (uint256 s; s < SECTORS; ++s) {
            bytes memory ang = _angleBytes(s * DPHI_MDEG);
            part[idx++] = G_OPEN; total += G_OPEN.length;
            part[idx++] = ang;    total += ang.length;
            part[idx++] = G_MID;  total += G_MID.length;

            for (uint8 r; r < 4; ++r) {
                bytes memory pref = store.prefix(r);
                bool black = (hash >> ((63 - s) * 4 + r)) & bytes32(uint256(1)) == 0;
                bytes memory col = black ? BLACK : WHITE;

                part[idx++] = pref;     total += pref.length;
                part[idx++] = col;      total += 7;
                part[idx++] = PATH_END; total += PATH_END.length;
            }
            part[idx++] = G_CLOSE; total += G_CLOSE.length;
        }

        // 2) 4 hash-lines
        for (uint8 line; line < 4; ++line) {
            bytes memory pre  = store.textPrefix(line);
            bytes memory data = _hex16(hash, line);

            part[idx++] = pre;      total += pre.length;
            part[idx++] = data;     total += 16;
            part[idx++] = TEXT_END; total += TEXT_END.length;
        }

        // 3) tail
        bytes memory tail = store.tail();
        part[idx++] = tail; total += tail.length;

        /* ───── 2. allocate memory and copy once ───── */
        bytes memory svgBuf = new bytes(total);
        uint256 off;
        for (uint256 i; i < part.length; ++i) {
            bytes memory p = part[i];
            uint256 len = p.length;
            if (len == 0) continue;
            assembly {
                let dst := add(add(svgBuf, 32), off)
                let src := add(p, 32)
                for { let j := 0 } lt(j, len) { j := add(j, 32) } {
                    mstore(add(dst, j), mload(add(src, j)))
                }
            }
            off += len;
        }
        return string(svgBuf);                 // ← plain SVG (no base64), useful for view tests
    }

    /* ───── helpers ───── */

    /* angle (‰°) → ASCII bytes (“0”, “5.625”, …) */
    function _angleBytes(uint256 v) private pure returns (bytes memory) {
        uint256 ip = v / 1000;
        uint256 fp = v % 1000;
        if (fp == 0) return _uDecBytes(ip);

        uint8 digs = 3;
        while (fp % 10 == 0) { fp /= 10; --digs; }
        return abi.encodePacked(_uDecBytes(ip), ".", _uDecBytes(fp, digs));
    }

    /* uint → ASCII bytes (min-width = width) */
    function _uDecBytes(uint256 v, uint8 width)
        private pure returns (bytes memory out)
    {
        while (width > 0 || v > 0) {
            out = abi.encodePacked(bytes1(uint8(48 + (v % 10))), out);
            v /= 10;
            if (width > 0) --width;
        }
        if (out.length == 0) out = "0";
    }
    function _uDecBytes(uint256 v) private pure returns (bytes memory) {
        return _uDecBytes(v, 0);
    }

    /* 16-nibble slice of the hash – line ∈ {0,1,2,3} */
    function _hex16(bytes32 h, uint8 line) private pure returns (bytes memory) {
        bytes memory out = new bytes(16);
        unchecked {
            for (uint8 i; i < 16; ++i) {
                uint8 nib = uint8(uint256(h) >> ((63 - (line * 16 + i)) * 4)) & 0xF;
                out[i] = bytes1(nib + (nib < 10 ? 48 : 87));
            }
        }
        return out;
    }
}

contracts/HashJingNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

/*──────────────────────────────  H a s h J i n g  ────────────────────────────────
Each NFT stores a 256‑bit seed. A separate on‑chain renderer converts that seed
into an SVG **mandala**. Two traits are fully derived on‑chain:

 • Balanced  – exactly 128 one‑bits in the hash
 • Passages  – number of empty “corridors” from centre to edge (flood‑fill on
               a 4 × 64 grid)

Metadata is returned as data‑URI JSON; the SVG is inlined, so the contract is
**100 % on‑chain**.
──────────────────────────────────────────────────────────────────────────────────*/

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Base64.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

interface IMandalaRenderer {
    function svg(bytes32 hash) external view returns (string memory);
}

contract HashJingNFT is ERC721, ERC2981, Ownable {
    using Strings for uint256;

    /*──────────────────────── State ─────────────────────────*/
    IMandalaRenderer public immutable renderer;
    mapping(uint256 => bytes32) private _seed;

    uint256 private _nextId = 1;

    uint256 public constant GENESIS_SUPPLY = 8_192;
    uint256 public constant GENESIS_PRICE  = 0.002 ether;
    uint96  public constant MAX_ROYALTY_BPS = 1_000;   // 10 %

    address payable public immutable treasury;

    /*──────────────────── Constructor ───────────────────────*/
    constructor(address rendererAddr)
        ERC721("HashJing", "HJ")            // ← collection name & symbol
        Ownable(msg.sender)
    {
        renderer = IMandalaRenderer(rendererAddr);
        treasury = payable(msg.sender);

        _setDefaultRoyalty(treasury, 750);     // 7.5 %
    }

    /*──────────────────────── Mint ──────────────────────────*/
    function mint() external payable {
        uint256 id = _nextId;
        require(id <= GENESIS_SUPPLY, "HashJingNFT: sold out");
        require(msg.value == GENESIS_PRICE, "HashJingNFT: wrong mint fee");

        _nextId = id + 1;
        _seed[id] = _generateSeed(id);
        _safeMint(msg.sender, id);
    }

    /*────────────────────── Withdraw ───────────────────────*/
    function withdraw() external {
        require(msg.sender == treasury, "Not treasury");
        (bool ok,) = treasury.call{value: address(this).balance}("");
        require(ok, "Withdraw failed");
    }

    /*────────────── Royalty management ──────────────*/
    function setRoyalty(address receiver, uint96 feeBps) external onlyOwner {
        require(feeBps <= MAX_ROYALTY_BPS, "Max 10%");
        _setDefaultRoyalty(receiver, feeBps);
    }

    /*────────────────────── Metadata ───────────────────────*/
    function tokenURI(uint256 id) public view override returns (string memory) {
        require(_existsLocal(id), "HashJingNFT: nonexistent token");

        bytes32 seed = _seed[id];
        string memory image = Base64.encode(bytes(renderer.svg(seed)));

        bool  balanced = _isBalanced(seed);
        uint8 passages = _countPassages(seed);

        string memory attrs = string.concat(
            '{ "trait_type":"Balanced", "value":"', balanced ? "true" : "false", '" },',
            '{ "trait_type":"Passages", "value":"', Strings.toString(passages), '" },',
            '{ "trait_type":"Seed", "value":"', Strings.toHexString(uint256(seed), 32), '" }'
        );

        string memory json = Base64.encode(
            abi.encodePacked(
                '{"name":"HashJing #', id.toString(), '",',
                '"description":"Fully on-chain HashJing mandala - a deterministic generative form derived from cryptographic entropy. Source hash: ',
                    Strings.toHexString(uint256(seed), 32), '",',
                '"creator":"DataSattva",',
                '"external_url":"https://github.com/DataSattva/hashjing",',
                '"license":"CC BY-NC 4.0",',
                '"image":"data:image/svg+xml;base64,', image, '",',
                '"attributes":[', attrs, ']}'
            )
        );
        return string.concat("data:application/json;base64,", json);
    }

    function totalSupply() external view returns (uint256) {
        return _nextId - 1;
    }

    /*───────────────────── Helpers ─────────────────────────*/
    function _existsLocal(uint256 id) internal view returns (bool) {
        return id != 0 && id < _nextId && _ownerOf(id) != address(0);
    }

    function _generateSeed(uint256 id) internal view returns (bytes32) {
        return keccak256(
            abi.encodePacked(blockhash(block.number - 1), block.timestamp, block.prevrandao, id, msg.sender)
        );
    }

    /*──────── Balanced (exactly 128 ones) ────────*/
    function _isBalanced(bytes32 hash) internal pure returns (bool) {
        uint256 ones;
        for (uint256 i = 0; i < 32; ++i) {
            ones += _countOnes(uint8(hash[i]));
        }
        return ones == 128;
    }

    function _countOnes(uint8 b) internal pure returns (uint8 c) {
        while (b != 0) {
            c += b & 1;
            b >>= 1;
        }
    }

    /*──────── Passages (flood-fill on 4 × 64 grid) ─────────*/
    function _toBitGrid(bytes32 hash) internal pure returns (uint8[64][4] memory grid) {
        for (uint256 i = 0; i < 32; ++i) {
            uint8 hi = uint8(hash[i]) >> 4;
            uint8 lo = uint8(hash[i]) & 0x0f;
            for (uint8 r = 0; r < 4; ++r) {
                grid[r][i * 2]     = (hi >> (3 - r)) & 1;
                grid[r][i * 2 + 1] = (lo >> (3 - r)) & 1;
            }
        }
        return grid;
    }

    function _countPassages(bytes32 hash) internal pure returns (uint8) {
        uint8[64][4] memory grid = _toBitGrid(hash);
        bool[64][4] memory visited;
        uint8 passages;

        for (uint8 s = 0; s < 64; ++s) {
            if (grid[0][s] != 0 || visited[0][s]) continue;
            bool[64][4] memory local;
            if (_bfs(grid, visited, local, s)) {
                passages++;
                for (uint8 r = 0; r < 4; ++r) {
                    for (uint8 c = 0; c < 64; ++c) {
                        if (local[r][c]) visited[r][c] = true;
                    }
                }
            }
        }
        return passages;
    }

    /*──────── BFS helpers ────────*/
    function _maybeEnqueue(
        uint8[64][4] memory grid,
        bool[64][4]  memory vis,
        bool[64][4]  memory loc,
        uint16[256]  memory qr,
        uint16[256]  memory qc,
        uint16 nr,
        uint16 nc,
        uint256 tail
    ) internal pure returns (uint256) {
        if (nr >= 4 || nc >= 64) return tail;
        if (loc[nr][nc] || vis[nr][nc] || grid[nr][nc] != 0) return tail;
        qr[tail] = nr;
        qc[tail] = nc;
        return tail + 1;
    }

    function _bfs(
        uint8[64][4] memory grid,
        bool[64][4]  memory vis,
        bool[64][4]  memory loc,
        uint8 startSector
    ) internal pure returns (bool reached) {
        uint16[256] memory qr;
        uint16[256] memory qc;
        uint256 head;
        uint256 tail;
        qr[0] = 0;
        qc[0] = startSector;
        tail = 1;

        while (head < tail) {
            uint16 r = qr[head];
            uint16 c = qc[head];
            head++;
            if (loc[r][c] || grid[r][c] != 0) continue;
            loc[r][c] = true;
            if (r == 3) reached = true;

            uint16[4] memory nr = [r + 1, r == 0 ? 0 : r - 1, r, r];
            uint16[4] memory nc = [c, c, (c + 1) % 64, (c + 63) % 64];
            for (uint8 i = 0; i < 4; ++i) {
                tail = _maybeEnqueue(grid, vis, loc, qr, qc, nr[i], nc[i], tail);
            }
        }
        return reached;
    }

    /*────────── ERC-165 support ──────────*/
    function supportsInterface(bytes4 iid)
        public
        view
        override(ERC721, ERC2981)
        returns (bool)
    {
        return super.supportsInterface(iid);
    }
}

